import Link from "next/link";
import fetch from "isomorphic-unfetch";
import Navbar from './components/navbar.js';
import React, { useEffect, useRef } from 'react';
import BackgroundVideo from './components/backgroundvideo'
import './assets/css/home.scss'

function Index (props) {
  return (
    <div>
      <Navbar/>
      <BackgroundVideo/>
      <div id='centerimgs'>
        <img src="/assets/images/coming.png" id='coming'/>
        <img src="/assets/images/mictlan.png" id='mictlan' />
        <img src="/assets/images/line.svg" id='line' />
        <p id='thegame'>THE GAME</p>
      </div>
      <div class="newsletter_form">
          <div class="newsletter_title_wrap">
              <div class="newsletter_title">
                  <span>Sign Up for</span>
                  <h3>Newsletter</h3>
              </div>
          </div>
          <div id="mc_embed_signup">
              <form action="./thank-you.html" method="post" id="mc-embedded-subscribe-form" name="mc-embedded-subscribe-form" class="validate" target="_blank" novalidate>
                  <div id="mc_embed_signup_scroll" class="form-group">
                  <input type="email" value="" name="EMAIL" class="email email-input" id="mce-EMAIL" placeholder="email address" required />
                  <div style={{position: "absolute", left: "-5000px"}} aria-hidden="true"><input type="text" name="b_52ca0fb86b335961ba7cef637_e6040d35f3" tabindex="-1" value="" /></div>
                  <div class="clear"><input type="submit" value="SEND" name="subscribe" id="mc-embedded-subscribe" class="button submit_btn" /></div>
                </div>
              </form>
          </div>
      </div>
    </div>
  )

};

Index.getInitialProps = async function() {
  const res = await fetch(
    "http://my-json-server.typicode.com/wrongakram/demo/products"
  );
  const data = await res.json();
  return {
    products: data
  };
};

export default Index;
